import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import Accordion from 'react-bootstrap/Accordion';

function App() {
  return (
    <div>
      <h2>CareerConnect</h2>
      <p>Discover, apply, and excel with our all-in-one web app designed for job seekers and recruiters alike. 
        Easily browse and apply for available jobs, courses, and internships tailored to your needs. 
        Streamline your hiring process as a company by posting job openings, managing applications, 
        and scheduling interviews effortlessly. Our intuitive platform ensures seamless connectivity between 
        talented individuals and rewarding opportunities. From job search to onboarding, 
        we've got you covered every step of the way. Join our community today and take the next leap in your career journey!</p>
    </div>
  )
}

export default App;
